import React, { useState } from "react";

const Signup = () => {
  const [user, setUser] = useState({
    name: "",
    email: "",
    password: "",
    passwordCon: ""
  });

  const { name, email, password, passwordCon } = user;

  return (
    <div className="containerRegister">
      <h1>Registrate</h1>
      <form>
        <div className="formContainer">
          <label>
            Nombre
          </label>
        </div>
      </form>
    </div>
  );
};

export default Signup;
